import React from 'react';

import { Paper, TextField } from '@materials'

class SearchBar extends React.Component {
    render (
        state = {
            searchTerm: '',
        }
    ) {
        return (
            <h1>This is a search bar component</h1>
        )
    }
}

export default SearchBar;
